
import React, { useState } from 'react';
import './ProbSolving.css';

const ProbSolving = () => {
  const eproblems = [
    {
      problem: 'Problem 1: Factorial of a number',
      image: 'data:image/png;base64,',
    },
    {
      problem: 'Problem 2: Solve a quadratic equation',
      image: 'data:image/jpeg;base64,',
    },
    {
      problem: 'Problem 3: Calculate the area of a rectangle',
      image: 'data:image/jpeg;base64,',
    },
    {
      problem: 'Problem 4: Find the prime factors of a number',
      image: 'data:image/jpeg;base64,',
    },
    {
      problem: 'Problem 5: Multiple of two numbers',
      image: 'data:image/jpeg;base64,',
    }
  ];

 
  const iproblems = [
    {
      problem: 'Intermediate Problem 1: Find the missing number in an array of consecutive integers.',
      image: 'url_for_problem_6_image.jpg',
    },
    {
      problem: 'Intermediate Problem 2: Implement a stack with push, pop, and min functions in O(1) time.',
      image: 'url_for_problem_7_image.jpg',
    },
    {
      problem: 'Intermediate Problem 3: Write a function to check if a string is a palindrome.',
      image: 'url_for_problem_8_image.jpg',
    },
    {
      problem: 'Intermediate Problem 4: Given an array of integers, find the maximum product of two integers.',
      image: 'url_for_problem_9_image.jpg',
    },
    {
      problem: 'Intermediate Problem 5: Implement binary search on a sorted array.',
      image: 'url_for_problem_10_image.jpg',
    }
  ];

  const hproblems = [
    {
      problem: 'Hard Problem 1: Implement a trie (prefix tree) and perform insert, delete, and search operations.',
      image: 'url_for_problem_11_image.jpg',
    },
    {
      problem: 'Hard Problem 2: Given a binary tree, find the maximum path sum.',
      image: 'url_for_problem_12_image.jpg',
    },
    {
      problem: 'Hard Problem 3: Solve the N-Queens problem (place N queens on an NN chessboard so that no two queens threaten each other).',
      image: 'url_for_problem_13_image.jpg',
    },
    {
      problem: 'Hard Problem 4: Implement a graph traversal algorithm such as Dijkstras or A*.',
      image: 'url_for_problem_14_image.jpg',
    },
    {
      problem: 'Hard Problem 5: Design and implement an LRU (Least Recently Used) cache.',
      image: 'url_for_problem_15_image.jpg',
    }
  ];

  const compilers = ['Compiler 1', 'Compiler 2', 'Compiler 3']; // Add your list of compilers here

  const [currentEProblemIndex, setCurrentEProblemIndex] = useState(0);
  const [currentIProblemIndex, setCurrentIProblemIndex] = useState(0);
  const [currentHProblemIndex, setCurrentHProblemIndex] = useState(0);

  const [selectedECompiler, setSelectedECompiler] = useState(compilers[0]);
  const [selectedICompiler, setSelectedICompiler] = useState(compilers[0]);
  const [selectedHCompiler, setSelectedHCompiler] = useState(compilers[0]);

  const eHandleNextProblem = () => {
    if (currentEProblemIndex < eproblems.length - 1) {
      setCurrentEProblemIndex((prevIndex) => prevIndex + 1);
    }
  };

  const eHandlePrevProblem = () => {
    if (currentEProblemIndex > 0) {
      setCurrentEProblemIndex((prevIndex) => prevIndex - 1);
    }
  };

  const iHandleNextProblem = () => {
    if (currentIProblemIndex < iproblems.length - 1) {
      setCurrentIProblemIndex((prevIndex) => prevIndex + 1);
    }
  };

  const iHandlePrevProblem = () => {
    if (currentIProblemIndex > 0) {
      setCurrentIProblemIndex((prevIndex) => prevIndex - 1);
    }
  };

  const hHandleNextProblem = () => {
    if (currentHProblemIndex < hproblems.length - 1) {
      setCurrentHProblemIndex((prevIndex) => prevIndex + 1);
    }
  };

  const hHandlePrevProblem = () => {
    if (currentHProblemIndex > 0) {
      setCurrentHProblemIndex((prevIndex) => prevIndex - 1);
    }
  };

  const currentEProblem = eproblems[currentEProblemIndex];
  const currentIProblem = iproblems[currentIProblemIndex];
  const currentHProblem = hproblems[currentHProblemIndex];
  const backgroundStyle = { backgroundImage: `url('https://images.pexels.com/photos/956981/milky-way-starry-sky-night-sky-star-956981.jpeg?auto=compress&cs=tinysrgb&w=600')` };

  return (
    <>
      <div style={backgroundStyle}><h1><b> BEGINNER LEVEL</b></h1></div>
      <div className="problem-solving-container">
        <div className="problem-container">
          <h2>Problems:</h2>
          <p>{currentEProblem.problem}</p>
          {currentEProblem.image && <img src={currentEProblem.image} alt="Problem Image" />}
          <div className="compiler-dropdown">
            <label>Select Compiler:</label>
            <select value={selectedECompiler} onChange={(e) => setSelectedECompiler(e.target.value)}>
              {compilers.map((compiler, index) => (
                <option key={index} value={compiler}>
                  {compiler}
                </option>
              ))}
            </select>
          </div>
          <div>
            <button onClick={eHandlePrevProblem} disabled={currentEProblemIndex === 0}>
              Previous Problem
            </button>
            <button onClick={eHandleNextProblem} disabled={currentEProblemIndex === eproblems.length - 1}>
              Next Problem
            </button>
          </div>
        </div>
        <div className="counter-container">
          <h2> OUTPUT </h2>
        </div>
        <div className="counter-container">
          <h2>Problems Seen:</h2>
          <p>{currentEProblemIndex + 1} / {eproblems.length}</p>
          {currentEProblemIndex === eproblems.length - 1 && <p>Completed</p>}
        </div>
      </div>

      {/* ... (similar code for Intermediate level) */}

      <div style={backgroundStyle}><h1><b> INTERMEDIATE LEVEL</b></h1></div>
      <div className="problem-solving-container">
        <div className="problem-container">
          <h2>Problems:</h2>
          <p>{currentIProblem.problem}</p>
          {currentIProblem.image && <img src={currentIProblem.image} alt="Problem Image" />}
          <div className="compiler-dropdown">
            <label>Select Compiler:</label>
            <select value={selectedICompiler} onChange={(e) => setSelectedICompiler(e.target.value)}>
              {compilers.map((compiler, index) => (
                <option key={index} value={compiler}>
                  {compiler}
                </option>
              ))}
            </select>
          </div>
          <div>
            <button onClick={iHandlePrevProblem} disabled={currentIProblemIndex === 0}>
              Previous Problem
            </button>
            <button onClick={iHandleNextProblem} disabled={currentIProblemIndex === iproblems.length - 1}>
              Next Problem
            </button>
          </div>
        </div>
        <div className="counter-container">
          <h2> OUTPUT </h2>
        </div>
        <div className="counter-container">
          <h2>Problems Seen:</h2>
          <p>{currentIProblemIndex + 1} / {iproblems.length}</p>
          {currentIProblemIndex === iproblems.length - 1 && <p>Completed</p>}
        </div>
      </div>
  {/* ... (similar code for Hard level) */}


  <div style={backgroundStyle}><h1><b> HARD LEVEL</b></h1></div>
      <div className="problem-solving-container">
        <div className="problem-container">
          <h2>Problems:</h2>
          <p>{currentHProblem.problem}</p>
          {currentHProblem.image && <img src={currentHProblem.image} alt="Problem Image" />}
          <div className="compiler-dropdown">
            <label>Select Compiler:</label>
            <select value={selectedHCompiler} onChange={(e) => setSelectedHCompiler(e.target.value)}>
              {compilers.map((compiler, index) => (
                <option key={index} value={compiler}>
                  {compiler}
                </option>
              ))}
            </select>
          </div>
          <div>
            <button onClick={hHandlePrevProblem} disabled={currentHProblemIndex === 0}>
              Previous Problem
            </button>
            <button onClick={hHandleNextProblem} disabled={currentHProblemIndex === hproblems.length - 1}>
              Next Problem
            </button>
          </div>
        </div>
        <div className="counter-container">
          <h2> OUTPUT </h2>
        </div>
        <div className="counter-container">
          <h2>Problems Seen:</h2>
          <p>{currentHProblemIndex + 1} / {hproblems.length}</p>
          {currentHProblemIndex === hproblems.length - 1 && <p>Completed</p>}
        </div>
      
      </div>
      

    </>
  );
};

export default ProbSolving;
